import React from 'react';
import './about.css';

export default function About() {
  return (
    <div className="about">
      <h2>About Our Food Ordering System</h2>
      <p>Welcome to our food ordering system! We are dedicated to providing you with a convenient and delicious way to order food from your favorite restaurants.</p>
      <p>Our system allows you to browse menus, place orders, and track deliveries all in one place. Whether you're craving pizza, sushi, or something sweet, we've got you covered.</p>
      <p>Thank you for choosing our food ordering system. We hope you enjoy your meal!</p>
      <p className="signature">- 
      FeastExpress
      
      </p>
    </div>
  );
}
